trailingComments.value:
*
 *  评论列表完成回调
 *
 *  支持平台：书旗Android、书旗iOS
 *
 *  @return {Promise.<void>} 0：传入参数解析失败 1：传入参数解析成功
 *
 *  @example
 *  libSQ.exec('openAppBookMakeComment', { params: {
 *   commentListBookId: '5696906',
 *  } }).then((info) => {
 *   console.log(`[openAppBookMakeComment][then] ${JSON.stringify(info, null, 2)}`);
 *  }).catch((err) => {
 *   alert(`[openAppBookMakeComment][error] ${JSON.stringify(err, null, 2)}`);
 *   const e = err.detail.__$rawError__;
 *   alert(e.message);
 *   alert(e.stack);
 * });

